import React from "react";
import { Button, Box, TextField, Container, TableRow } from "@mui/material";
function Login() {
  return (
    <Box sx={{ width: "100%", maxWidth: 360, bgcolor: "yellow" }}>
      <TableRow>
        <TextField id="outlined-basic" label="Username" variant="outlined" />
        <TextField
          id="outlined-password-input"
          label="Password"
          type="password"
          autoComplete="current-password"
        />
      </TableRow>
      <TableRow>
        <Button fullWidth variant="contained" sx={{}}>Login</Button>
      </TableRow>
    </Box>
  );
}

export default Login;
